import { Suspense } from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Navbar from "./components/navbar/Navbar";
import Sidebar from "./components/sidebar/Sidebar";
import CSSProps from "./data/constants/CSSProps";
import Paths from "./data/constants/Paths";
import About from "./pages/about/About";
import Home from "./pages/home/Home";
import Servicedesk from "./pages/servicedesk/Servicedesk";
import Organisation from "./pages/organisation/Organisation";
import Tasks from "./pages/tasks/Tasks";
import Dashboard from "./pages/dashboard/Dashboard";
import Profile from "./pages/profile/Profile";
import Login from "./pages/login/Login";
import Settings from "./pages/settings/Settings";

const App = () => {
  return (
    <Suspense fallback="loading">
      <Router>
        <div className={CSSProps.App}>
          <Navbar />
          <Sidebar />
          <div className="host">
            <div className="hostbody">
              <Switch>
                <Route exact path={Paths.Home}>
                  <Home />
                </Route>
                <Route exact path={Paths.Servivedesk}>
                  <Servicedesk />
                </Route>
                <Route path={Paths.About}>
                  <About />
                </Route>
                <Route exact path={Paths.Organisation}>
                  <Organisation />
                </Route>
                <Route exact path={Paths.Tasks}>
                  <Tasks />
                </Route>
                <Route exact path={Paths.Dashboard}>
                  <Dashboard />
                </Route>
                <Route exact path={Paths.Profile}>
                  <Profile />
                </Route>
                <Route exact path={Paths.Login}>
                  <Login />
                </Route>
                <Route exact path={Paths.Settings}>
                  <Settings />
                </Route>
              </Switch>
            </div>
          </div>
        </div>
      </Router>
    </Suspense>
  );
};

export default App;
